import Home from "./Pages/Home/Home";
import { Route, Switch, } from "react-router-dom";

function App() {
  return (
    <>
    <Switch>
      <Route path="/">
        <Redirect path="/home" />
      </Route>
      <Route path="/home">
        <Home />
      </Route>
    </Switch>
    </>
  );
}

export default App;
